import Yo from "./Imagenes/Yo.jpeg";
import "./Estilos/Estilos.css";
export default function SobreMi(){
    return(
        <div className="SobreMi-Todo">

            <div className="SobreMi">

                <div className="SobreMi-Dos">
                    <span className="SobreMi-Nombre">Luis Duran</span>
                    <img src="" alt="" />
                    <img className="SobreMi-Imagen" src={Yo}/>
                </div>

                <div className="SobreMi-Tres">
                    <p className="SobreMi-Texto">Hola!, Me llamo Luis Duran, Soy de Argentina y este es mi proyecto de Rick and Morty, espero que si alguien lo ve, despierte en el las ganas de hacer el suyo y mucho mejor que este!</p>
                </div>

                </div>

        </div>
        
    )
}
